# 20 20

map = map.strip().split('\n')
map = [list(line) for line in map]

dirs = [(-1,0),(1,0),(0,-1),(0,1)]


is_alive = 0
def walk(x,y):
    global is_alive
    if is_alive:
        return

    if 0<=x<1000 and 0<=y<1000:
        if map[x][y] in '.e':
            map[x][y] = '%'
            for dx, dy in dirs:
                walk(x+dx,y+dy)
        elif map[x][y] == '~':
            is_alive = 1
            return

    return

def print_map(map):
    for line in map:
        print(''.join(line))

